import React from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';
import { useI18n } from '../../context/I18nContext';
import { useTheme } from '../../context/ThemeContext';

const heroBg = {
  background: 'radial-gradient(1200px 600px at 80% -10%, rgba(102,126,234,0.35), transparent), radial-gradient(800px 400px at 20% -10%, rgba(118,75,162,0.35), transparent)',
};

const LandingPage = () => {
  const { t, lang } = useI18n();
  const { isDark } = useTheme();
  return (
    <div style={{ minHeight: '100vh', background: isDark ? '#0b1020' : '#0b1020', color: 'white' }}>
      {/* Hero */}
      <div style={{ ...heroBg }}>
        <div className="container" style={{ paddingTop: 80, paddingBottom: 60 }}>
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            className="text-center"
          >
            <h1 style={{ fontSize: 48, lineHeight: 1.2, marginBottom: 16, fontWeight: 800 }}>
              {lang === 'ar' ? 'إدارة شركتك ومشاريعك بذكاء' : 'Manage your company and projects smarter'}
            </h1>
            <p style={{ color: '#cbd5e1', maxWidth: 720, margin: '0 auto 24px' }}>
              {lang === 'ar' ?
                'AiThor يمنحك أدوات قوية لإدارة الشركة والمنتجات والعملاء، مع دردشة مدعومة بالذكاء الاصطناعي لتسريع نمو أعمالك.' :
                'AiThor gives you powerful tools to manage your company, products and customers, with AI chat to accelerate your growth.'}
            </p>
            <div style={{ display: 'flex', gap: 12, justifyContent: 'center' }}>
              <Link to="/dashboard" className="btn btn-primary">{lang === 'ar' ? 'ابدأ الآن' : 'Get Started'}</Link>
              <Link to="/register" className="btn btn-secondary">{lang === 'ar' ? 'جرّبه مجانًا' : 'Try for Free'}</Link>
            </div>
          </motion.div>

          {/* Animated cards */}
          <div className="grid grid-3" style={{ marginTop: 40 }}>
            {[{
              title: 'لوحة تحكم بديهية',
              text: 'تابع بيانات الشركة والعملاء بسهولة مع واجهة عربية متقنة.'
            }, {
              title: 'إدارة مشاريع ومنتجات',
              text: 'أضف منتجات وأسعارًا وFAQ وتابع كل شيء في مكان واحد.'
            }, {
              title: 'دردشة ذكاء اصطناعي',
              text: 'تفاعل مع العملاء بسرعة عبر AI مدمج مخصص لشركتك.'
            }].map((f, i) => (
              <motion.div
                key={i}
                initial={{ opacity: 0, y: 20 }}
                whileInView={{ opacity: 1, y: 0 }}
                viewport={{ once: true }}
                transition={{ delay: 0.1 * i, duration: 0.5 }}
                className="card"
                style={{ background: 'rgba(255,255,255,0.06)', border: '1px solid rgba(255,255,255,0.12)' }}
              >
                <h3 style={{ color: '#a5b4fc', marginBottom: 8 }}>{f.title}</h3>
                <p style={{ color: '#cbd5e1' }}>{f.text}</p>
              </motion.div>
            ))}
          </div>
        </div>
      </div>

      {/* CTA */}
      <div style={{ background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)', marginTop: 40 }}>
        <div className="container" style={{ padding: '36px 0', textAlign: 'center' }}>
          <motion.h2
            initial={{ scale: 0.95, opacity: 0 }}
            whileInView={{ scale: 1, opacity: 1 }}
            viewport={{ once: true }}
            transition={{ duration: 0.5 }}
            style={{ marginBottom: 12 }}
          >
            {lang === 'ar' ? 'جاهز للإنطلاق؟' : 'Ready to launch?'}
          </motion.h2>
          <p style={{ color: 'white', opacity: 0.85, marginBottom: 16 }}>
            {lang === 'ar' ? 'ابدأ خلال دقيقة وبدون بطاقة ائتمانية' : 'Start in a minute, no credit card required'}
          </p>
          <Link to="/register" className="btn btn-secondary" style={{ background: 'white' }}>
            {lang === 'ar' ? 'إنشاء حساب' : 'Create Account'}
          </Link>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
